import {StyleSheet} from "react-native"

export default StyleSheet.create({
    body: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: "space-around"
      },
      header: {
        width: '90%',
        height: '15%',
        borderBottomWidth: 2,
        justifyContent: "space-between",
        alignItems: 'center',
        flexDirection: 'row'
      },
      image:{
        width: 130,
        height: 100
      },
      card: {
        width: "40%",
        height: "10%",
        backgroundColor: "red",
        borderColor: 'black',
        borderWidth: 2,
        alignItems: 'center',
        justifyContent: "center"
      },
      title:{
        fontSize: 18
      }
})
